import "./style.css";
import Navbar from '../navbar/navbar.js';

const Header = () => {
    return (

        <header>
            <div className="header">
                <ul className="logo"> 
                    <li className="logo--item">Краснолесья</li>
                    <li className="logo--item"><strong>14</strong> корпус <strong>5</strong></li>
                    <li className="logo--item">ТCЖ</li>
                </ul>
                <Navbar />
            </div>
        </header>

    );
  }
  
  export default Header;
